import React from "react";
import { NavLink } from "react-router-dom";

const MainNavigation = () => {
  return (
    <ul className="list">
      <li>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "undefined")}
        end
        >
          Home
        </NavLink>

      </li>
      <li>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "undefined")}
        >
          About
        </NavLink>
      </li>
      <li>
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "undefined")}
        >
          Events
        </NavLink>
      </li>
    </ul>
  );
};

export default MainNavigation;
